INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 44, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 8, 16, "ヒヨリ", "人助けが大好き！　前向き格闘娘", "A", 2, "人助け、応援", 27, "東山奈央", "獣人族", "トゥインクルウィッシュ", 100101, 155);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 47, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", 4, 17, "ユイ", "戦闘のサポートが得意な、心優しい少女", "O", 2, "料理、人間観察", 5, "種田梨沙", "ヒューマン", "トゥインクルウィッシュ", 100201, 158);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 46, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 1, 18, "レイ", "クールで何事にも真っ直ぐな剣士", "B", 2, "読書、乗馬、お茶", 12, "早見沙織", "魔族", "トゥインクルウィッシュ", 100301, 163);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 27, "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪", 8, 9, "ミソギ", "探検好きのイタズラっ子", "O", 5, "いたずら、探検", 10, "諸星すみれ", "ヒューマン", "リトルリリカル", 100401, 128);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 40, "？？？", 11, 12, "マツリ", "ヒーローに憧れる騎士見習いの少女", "O", 8, "ヒーローごっこ", 25, "下田麻美", "獣人族", "王宮騎士団（NIGHTMARE）", 100501, 146);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 42, "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！", 11, 13, "アカリ", "甘え上手なみんなの人気者", "O", 7, "サックス", 22, "浅倉杏美", "魔族", "悪魔偽王国軍（ディアボロス）", 100601, 150);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 32, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", 1, 14, "ミヤコ", "プリン大好きゴースト娘", "B", 7, "プリンを食べること", 23, "雨宮天", "魔族", "悪魔偽王国軍（ディアボロス）", 100701, 130);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 40, "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", 10, 14, "ユキ", "ボクは誰よりも美しい", "AB", 15, "鏡で自分を見ること", 10, "大空直美", "エルフ", "ヴァイスフリューゲル　ランドソル支部", 100801, 150);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 45, "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", 7, 17, "アンナ", "前世を信じる中二病患者、「疾風の冥姫」", "A", 13, "小説執筆", 5, "髙野麻美", "魔族", "トワイライトキャラバン", 100901, 159);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 42, "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", 9, 16, "マホ", "マホマホ王国のプリンセス", "O", 10, "空想、ぬいぐるみ集め", 22, "内田真礼", "獣人族", "自警団（カォン）", 101001, 155);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 44, "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", 8, 15, "リノ", "人懐っこくてマシンガントークな妹系少女", "A", 3, "お裁縫", 25, "阿澄佳奈", "ヒューマン", "ラビリンス", 101101, 156);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 46, "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！", 12, 17, "ハツネ", "みんなのために超能力を使う眠り姫", "A", 6, "妹と遊ぶこと、二度寝、昼寝、早寝", 24, "大橋彩香", "エルフ", "フォレスティエ", 101201, 156);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 55, "", 8, 18, "ナナカ", "オタク全開な魔法少女", "O", 13, "読書、魔法", 21, "佳村はるか", "魔族", "トワイライトキャラバン", 101301, 166);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 41, "test", 11, 15, "カスミ", "頭脳明晰な美少女名探偵", "AB", 10, "読書、推理", 3, "水瀬いのり", "獣人族", "自警団（カォン）", 101401, 152);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 54, "test", 9, 21, "ミサト", "母性溢れる優しいみんなの「ミサト先生」", "O", 6, "絵本作り", 5, "國府田マリ子", "エルフ", "フォレスティエ", 101501, 165);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 48, "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", 4, 18, "スズナ", "天真爛漫で人気者のカリスマモデル", "O", 14, "ファッション", 10, "上坂すみれ", "魔族", "ルーセント学院", 101601, 167);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 53, "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", 7, 19, "カオリ", "いつでも「なんくるないさ～」な天然娘", "A", 10, "踊り、空手", 7, "高森奈津美", "獣人族", "自警団（カォン）", 101701, 158);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 52, "いつも助けてくれてありがとう\n私のほうが年上なのに\n頼ってばかりでごめんなさい～", 8, 23, "イオ", "多くの男性を魅了する無垢な女教師", "B", 14, "恋愛小説、恋愛舞台、恋愛漫画の鑑賞", 14, "伊藤静", "魔族", "ルーセント学院", 101801, 162);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 21, "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", 4, 10, "ミミ", "お歌もにんじんも、ウサギさんも大好き♪", "O", 5, "かわいいもの集め", 3, "日高里菜", "獣人族", "リトルリリカル", 102001, 117);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 40, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 6, 12, "クルミ", "泣き虫で臆病な守ってあげたい女の子", "B", 9, "観劇、おままごと", 9, "植田佳奈", "ヒューマン", "サレンディア救護院", 102101, 150);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 40, "え、えっと…こ、こういうときって、\nどういうことを言えばいいんだっけ…\nうう、どうしてちゃんと喋れないの…", 11, 13, "ヨリ", "人見知りであまのじゃくな女の子", "O", 7, "ゲーム全般", 22, "原紗友里", "魔族", "悪魔偽王国軍（ディアボロス）", 102201, 150);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 38, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", 5, 14, "アヤネ", "ぷうきちといつも一緒！", "B", 9, "屋内でできる遊び", 10, "芹澤優", "ヒューマン", "サレンディア救護院", 102301, 148);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 43, "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", 12, 15, "スズメ", "お嬢さまのためにがんばるドジっ娘メイド", "O", 9, "ご奉仕", 12, "悠木碧", "ヒューマン", "サレンディア救護院", 102501, 154);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 42, "test", 1, 17, "リン", "遊びと睡眠が何より大事なぐうたら娘", "B", 11, "あんパン", 1, "小岩井ことり", "獣人族", "牧場（エリザベスパーク）", 102601, 144);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 43, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", 7, 16, "エリコ", "運命の相手に一途すぎる乙女", "B", 13, "実験、裁縫、料理", 30, "橋本ちなみ", "魔族", "トワイライトキャラバン", 102701, 154);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 43, "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！", 10, 17, "サレン", "救護院を経営する優しい庶民派お嬢様", "A", 9, "経営、お茶会", 4, "堀江由衣", "エルフ", "サレンディア救護院", 102801, 156);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 40, "いつか世界中の人達をファンにしてみせる！\nトップアイドルになるその日まで、\n応援よろしくね♪", 1, 17, "ノゾミ", "歌って踊れる大人気アイドル", "B", 4, "舞台鑑賞、ダンス", 24, "日笠陽子", "ヒューマン", "カルミナ", 102901, 157);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 51, "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", 8, 16, "ニノン", "トーゴクの神秘、オシエテクダサイ！", "O", 15, "忍法開発", 31, "佐藤聡美", "ヒューマン", "ヴァイスフリューゲル　ランドソル支部", 103001, 163);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 42, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", 12, 18, "シノブ", "占いが得意な霊能少女", "AB", 7, "占い", 22, "大坪由佳", "魔族", "悪魔偽王国軍（ディアボロス）", 103101, 157);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 45, "この私とともにいる限り、\nお金に不自由はさせませんわ！", 3, 18, "アキノ", "一人前の商人を目指すパワフルお嬢様", "AB", 12, "慈善事業", 12, "松嵜麗", "ヒューマン", "メルクリウス財団", 103201, 157);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 35, "オラはどんな時でもみんなに笑顔を届ける\n最高の芸人目指してる！\n一緒に頑張るべ！", 3, 20, "マヒル", "みんなを笑顔にするお笑い牧場主", "B", 11, "漫才", 3, "新田恵海", "ヒューマン", "牧場（エリザベスパーク）", 103301, 142);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 55, "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？", 3, 22, "ユカリ", "純情でほっとけない大人の女性", "A", 12, "ウインドーショッピング", 16, "今井麻美", "エルフ", "メルクリウス財団", 103401, 164);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 21, "test", 2, 8, "キョウカ", "礼儀正しくしっかり者のちびっ子優等生", "A", 5, "お勉強", 2, "小倉唯", "エルフ", "リトルリリカル", 103601, 118);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 43, "test", 8, 13, "トモ", "義理堅くてからかい好きな剣術少女", "A", 8, "剣術、年長者をからかう", 11, "茅原実里", "ヒューマン", "王宮騎士団（NIGHTMARE）", 103701, 149);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 40, "ゴホッ、ゴホッ…か、身体は弱いけど、\nせめて気持ちだけでも前向きに…！\nあっ、でもダメ…立ちくらみが…", 11, 14, "シオリ", "読書が趣味の病弱少女", "A", 11, "読書、お散歩", 3, "小清水亜美", "獣人族", "牧場（エリザベスパーク）", 103801, 153);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 44, "友達ができるその日まで…\nBB団で\nトレーニングですっ！", 6, 13, "アオイ", "「友達」に憧れる、エルフの森の女の子", "AB", 6, "友達作りのイメトレ", 6, "花澤香菜", "エルフ", "フォレスティエ", 104001, 158);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 46, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 6, 17, "チカ", "人々を守るために歌う、唱喚士の少女", "O", 4, "各種楽器", 3, "福原綾香", "ヒューマン", "カルミナ", 104201, 163);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 54, "腹へってたら言えよな\n簡単でよければ\nすっげー旨いもん食わせてやるよ！", 8, 17, "マコト", "男勝りで情に厚いワイルド娘", "O", 10, "お菓子作り", 9, "小松未可子", "獣人族", "自警団（カォン）", 104301, 168);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 50, "test", 5, "??", "イリヤ", "かつては夜を支配した最強の吸血鬼", "A", 7, "世界征服", 5, "丹下桜", "魔族", "悪魔偽王国軍（ディアボロス）", 104401, 172);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 49, "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", 11, 18, "クウカ", "妄想大好き！　ほんとは照れ屋な女の子", "AB", 15, "小説を読むこと", 19, "長妻樹里", "ヒューマン", "ヴァイスフリューゲル　ランドソル支部", 104501, 157);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 48, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", 3, 18, "タマキ", "弱きを助け強きをくじく猫娘", "AB", 12, "猫とたわむれること", 1, "沼倉愛美", "獣人族", "メルクリウス財団", 104601, 158);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 50, "？？？", 10, 25, "ジュン", "素顔を見せない冷静沈着な女性騎士", "A", 8, "格闘技、湯浴み", 25, "川澄綾子", "ヒューマン", "王宮騎士団（NIGHTMARE）", 104701, 171);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 49, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", 11, 20, "ミフユ", "仕事も私事も効率優先な傭兵少女", "O", 12, "傭兵などのアルバイト", 11, "田所あずさ", "ヒューマン", "メルクリウス財団", 104801, 163);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 54, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", 10, 18, "シズル", "お姉ちゃんがお世話してあげるからねっ！", "O", 3, "家事全般", 24, "生天目仁美", "ヒューマン", "ラビリンス", 104901, 168);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 22, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", 1, 11, "ミサキ", "ちょっとおませな恋に恋する女の子", "A", 14, "ファッション誌鑑賞、コスメ集め", 3, "久野美咲", "魔族", "ルーセント学院", 105001, 120);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 53, "私は科学者だけど、\n医者の真似事もしてるの\n病気になったら診てあげるわ", 3, 27, "ミツキ", "実験が趣味の危険な科学者", "A", 13, "研究、実験", 7, "三石琴乃", "ヒューマン", "トワイライトキャラバン", 105101, 166);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 100, "私、ごく普通の、どこにでもいる女の子よ！\nみ、見た目以外はね…", 3, 18, "リマ", "乙女チックなもふもふアニマル", "A", 11, "毛繕い、お喋り", 14, "徳井青空", "獣人族", "牧場（エリザベスパーク）", 105201, 150);
