INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 43, "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", 12, 15, "スズメ（サマー）", "お嬢さまのためにがんばるドジっ娘メイド", "O", 9, "ご奉仕", 12, "悠木碧", "ヒューマン", "サレンディア救護院", 107701, 154);
