INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 48, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", 3, 18, "タマキ（サマー）", "弱きを助け強きをくじく猫娘", "AB", 12, "猫とたわむれること", 1, "沼倉愛美", "獣人族", "メルクリウス財団", 107901, 158);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 49, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", 11, 20, "ミフユ（サマー）", "仕事も私事も効率優先な傭兵少女", "O", 12, "傭兵などのアルバイト", 11, "田所あずさ", "ヒューマン", "メルクリウス財団", 108001, 163);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 42, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", 12, 18, "シノブ（ハロウィン）", "占いが得意な霊能少女", "AB", 7, "占い", 22, "大坪由佳", "魔族", "悪魔偽王国軍（ディアボロス）", 108101, 157);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 32, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", 1, 14, "ミヤコ（ハロウィン）", "プリン大好きゴースト娘", "B", 7, "プリンを食べること", 23, "雨宮天", "魔族", "悪魔偽王国軍（ディアボロス）", 108201, 130);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 22, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", 1, 11, "ミサキ（ハロウィン）", "ちょっとおませな恋に恋する女の子", "A", 14, "ファッション誌鑑賞、コスメ集め", 3, "久野美咲", "魔族", "ルーセント学院", 108301, 120);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 46, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 6, 17, "チカ（クリスマス）", "人々を守るために歌う、唱喚士の少女", "O", 4, "各種楽器", 3, "福原綾香", "ヒューマン", "カルミナ", 108401, 163);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 40, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 6, 12, "クルミ（クリスマス）", "泣き虫で臆病な守ってあげたい女の子", "B", 9, "観劇、おままごと", 9, "植田佳奈", "ヒューマン", "サレンディア救護院", 108501, 150);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 38, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", 5, 14, "アヤネ（クリスマス）", "ぷうきちといつも一緒！", "B", 9, "屋内でできる遊び", 10, "芹澤優", "ヒューマン", "サレンディア救護院", 108601, 148);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 44, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 8, 16, "ヒヨリ（ニューイヤー）", "人助けが大好き！　前向き格闘娘", "A", 2, "人助け、応援", 27, "東山奈央", "獣人族", "トゥインクルウィッシュ", 108701, 155);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 47, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", 4, 17, "ユイ（ニューイヤー）", "戦闘のサポートが得意な、心優しい少女", "O", 2, "料理、人間観察", 5, "種田梨沙", "ヒューマン", "トゥインクルウィッシュ", 108801, 158);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 46, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 1, 18, "レイ（ニューイヤー）", "クールで何事にも真っ直ぐな剣士", "B", 2, "読書、乗馬、お茶", 12, "早見沙織", "魔族", "トゥインクルウィッシュ", 108901, 163);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 43, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", 7, 16, "エリコ（バレンタイン）", "運命の相手に一途すぎる乙女", "B", 13, "実験、裁縫、料理", 30, "橋本ちなみ", "魔族", "トワイライトキャラバン", 109001, 154);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 54, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", 10, 18, "シズル（バレンタイン）", "お姉ちゃんがお世話してあげるからねっ！", "O", 3, "家事全般", 24, "生天目仁美", "ヒューマン", "ラビリンス", 109101, 168);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 55, "私はアン！一応、マナリア王国の\n第一王女だけど…あまりかしこまらないで、\n気軽に仲良くしてくれたら嬉しいな！", 12, 17, "アン", "英霊と契約を結んだマナリアの天才王女", "AB", "", "読書", 1, "日笠陽子", "ヒューマン", "？？？", 109201, 156);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 45, "ルゥはルゥですぅ！マナリア魔法学院に\n通ってるですぅ。あなたもルゥの\nお友だちになってくれるですか？", 2, 15, "ルゥ", "マナリア魔法学院の新入生", "O", "", "食べること、眠ること", 4, "こやまきみこ", "ヒューマン", "？？？", 109301, 144);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 67, "私はグレア。竜と人、両方の血を\n受け継いでいるの…\nえっと…よ、よろしくね", 11, 17, "グレア", "人を超越した力を有す心優しい竜姫", "B", "", "ピアノ", 3, "福原綾香", "半人半竜", "？？？", 109401, 167);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 49, "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", 11, 18, "クウカ（オーエド）", "妄想大好き！　ほんとは照れ屋な女の子", "AB", 15, "小説を読むこと", 19, "長妻樹里", "ヒューマン", "ヴァイスフリューゲル　ランドソル支部", 109501, 157);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, 51, "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", 8, 16, "ニノン（オーエド）", "トーゴクの神秘、オシエテクダサイ！", "O", 15, "忍法開発", 31, "佐藤聡美", "ヒューマン", "ヴァイスフリューゲル　ランドソル支部", 109601, 163);
